import {ADD_NEW_MESSAGE, FETCHED_MESSAGES, DELETE_NEW_MESSAGE} from './actionsType';

export const addMessage = (data) =>{
    return{
        type:ADD_NEW_MESSAGE,
        payload:data
    };
};
export const addFetchedMessage = (data) =>{
    return{
        type:DELETE_NEW_MESSAGE,
        payload:data
    };
};
